import React from 'react';
import './CookieInfo.scss';
import { FaCookieBite } from 'react-icons/fa';

const CookieInfo = (props) => {
    return(
        <div className="CookiesInfo">
            <div className="CookiesContent">
                <FaCookieBite size={50}/>
                <div>
                    <h4>A MOŻE BY TAK CIASTECZKO...</h4>
                    <p>Informujemy, że nasza strona wykorzystuje pliki cookies. Jest to niezbędne dla zagwarantowania w pełni funkcjonalnego serwisu.</p>
                </div>
            </div>
        </div>
    )
}

export default CookieInfo;
